  var err =
    !props.noValidate &&
    PropTypes.any.isRequired(props, name, componentName, ...args)

  if (props[name]) {
    let schema = props[name]
    if (!schema.__isYupSchema__ && !(schema.resolve && schema.validate))
      err = new Error(
        '`schema` must be a proper yup schema: (' + componentName + ')'
      )
  }

  return err
}

